import * as React from 'react';
import { AppBar, Box, createTheme, Toolbar, Typography } from '@mui/material';
import styled from '@emotion/styled';

import logo from '../assets/110pm_emblem_transparent.png';

const Logo = styled('img')(() => ({
  width: '6rem'
}))

const textThemes = createTheme({
  typography: {
    h2: {
      fontSize: '1rem',
      fontWeight: 500
    }
  }
})

export default function NavbarV2() {
  return (
    <Box flex={1}>
      <AppBar position="static">
        <Toolbar style={{
          height: '8rem',
          display: 'flex',
          flexDirection: 'row'
        }}>
          <Logo src={logo}></Logo>
          <Box>
            <Typography variant='h2'>ΠΟΛΕΜΙΚΗ ΑΕΡΟΠΟΡΙΑ</Typography>
            <Typography variant='h2'>110 ΠΜ</Typography>
          </Box>

        </Toolbar>
      </AppBar>
    </Box>
  );
}
